using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// Use a navigation controller delegate (a custom object that implements this protocol) to modify behavior when a view controller is pushed or popped from the navigation stack of a UINavigationController object.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UINavigationControllerDelegate_Protocol/index.html#//apple_ref/occ/intf/UINavigationControllerDelegate"/>    [iOSVersion(2)]    public interface UINavigationControllerDelegate//: NSObjectProtocol    {        /// <summary>        /// Called just before the navigation controller displays a view controller’s view and navigation item properties.        /// </summary>        /// <param name="navigationController">The navigation controller that is showing the view and properties of a view controller.</param>        /// <param name="willShowViewController">The view controller whose view and navigation item properties are being shown.</param>        /// <param name="animated">true to animate the transition; otherwise, false.</param>        //[iOSVersion(2)]        //[Export("navigationController")]        //[Optional]        void NavigationController(UINavigationController navigationController, UIViewController willShowViewController, bool animated);                /// <summary>        /// Called just after the navigation controller displays a view controller’s view and navigation item properties.        /// </summary>        /// <param name="navigationController">The navigation controller that is showing the view and properties of a view controller.</param>        /// <param name="didShowViewController">The view controller whose view and navigation item properties are being shown.</param>        /// <param name="animated">true to animate the transition; otherwise, false.</param>        /// <param name="NAME_YOUR_PARAMS">DO NOT USE THIS PARAMETER - Instead make sure to name the parameters you're using.</param>        //[iOSVersion(2)]        //[Export("navigationController")]        //[Optional]        //[IgnoreParameter("NAME_YOUR_PARAMS")]        void NavigationController(UINavigationController navigationController, UIViewController didShowViewController, bool animated, bool NAME_YOUR_PARAMS = false);                /// <summary>        /// Called to allow the delegate to return a noninteractive animator object for use during view controller transitions.        /// </summary>        /// <param name="navigationController">The navigation controller whose navigation stack is changing.</param>        /// <param name="animationControllerForOperation">The type of transition operation that is occurring. For a list of possible values, see the “UINavigationControllerOperation” constants.</param>        /// <param name="fromViewController">The currently visible view controller.</param>        /// <param name="toViewController">The view controller that should be visible at the end of the transition.</param>        //[iOSVersion(7)]        //[Export("navigationController")]        //[Optional]        UIViewControllerAnimatedTransitioning NavigationController(UINavigationController navigationController, UINavigationControllerOperation animationControllerForOperation, UIViewController fromViewController, UIViewController toViewController);                /// <summary>        /// Called to allow the delegate to return an interactive animator object for use during view controller transitions.        /// </summary>        /// <param name="navigationController">The navigation controller whose navigation stack is changing.</param>        /// <param name="interactionControllerForAnimationController">The noninteractive animator object provided by the delegate’s navigationController:animationControllerForOperation:fromViewController:toViewController: method.</param>        //[iOSVersion(7)]        //[Export("navigationController")]        //[Optional]        UIViewControllerInteractiveTransitioning NavigationController(UINavigationController navigationController, UIViewControllerAnimatedTransitioning interactionControllerForAnimationController);                /// <summary>        /// Returns the preferred orientation for presentation of the navigation controller, as determined by the delegate.        /// </summary>        /// <param name="navigationController">The navigation controller</param>        //[iOSVersion(7)]        //[Export("navigationControllerPreferredInterfaceOrientationForPresentation")]        //[Optional]        UIInterfaceOrientation NavigationControllerPreferredInterfaceOrientationForPresentation(UINavigationController navigationController);                /// <summary>        /// Returns the complete set of supported interface orientations for the navigation controller, as determined by the delegate.        /// </summary>        /// <param name="navigationController">The navigation controller</param>        //[iOSVersion(7)]        //[Export("navigationControllerSupportedInterfaceOrientations")]        //[Optional]        int NavigationControllerSupportedInterfaceOrientations(UINavigationController navigationController);    }    /// <summary>    /// These constants define the type of navigation controller transitions that can occur.    /// </summary>    [iOSVersion(7)]    public enum UINavigationControllerOperation    {        /// <summary>        /// No operation is taking place.        /// </summary>        [iOSVersion(7)]        None,        /// <summary>        /// A view controller is being pushed onto the navigation stack.        /// </summary>        [iOSVersion(7)]        Push,        /// <summary>        /// The topmost view controller is being removed from the navigation stack.        /// </summary>        [iOSVersion(7)]        Pop,    }}